tables.table_schema:
CREATE TABLE quantum_algorithms (
    algorithm_id INT PRIMARY KEY,
    algorithm_name VARCHAR(50) NOT NULL,
    algorithm_description TEXT,
    algorithm_code TEXT
);

CREATE TABLE quantum_algorithms (
    algorithm_id INT PRIMARY KEY,
    algorithm_name VARCHAR(255) NOT NULL,
    encryption_key VARCHAR(512) NOT NULL,
    description TEXT
);

CREATE TABLE QuantumUsers (
    user_id UUID PRIMARY KEY,
    username VARCHAR(100) NOT NULL,
    email VARCHAR(255),
    created_at TIMESTAMP
);

CREATE TABLE QuantumAlgorithms (
    algorithm_id INT PRIMARY KEY,
    algorithm_name VARCHAR(255) NOT NULL,
    description TEXT,
    created_at TIMESTAMP
);

CREATE TABLE AlgorithmAuthors (
    author_id INT PRIMARY KEY,
    author_name VARCHAR(255) NOT NULL
);

CREATE TABLE AlgorithmCategories (
    category_id INT PRIMARY KEY,
    category_name VARCHAR(255) NOT NULL
);
